<script type="bf1f681bd3a67f8b1f5529b3-text/javascript">
    //stop click dropdown content area
    $(document).on('click', '.dropdown-menu', function (e) {
        e.stopPropagation();
    });

    function filter_data(page=1)
    {

        var category = "graphics-design" ;
       
        var concatUrl = '?';
        
        var searchKey = $("#searchKey").val();
        if(searchKey != '' ){
            concatUrl += 'q='+searchKey;
        }
        
    
        //remove open class and again add btn-group class
        $('body').find('.open').removeClass().addClass('btn-group');


        var services = get_filter('services');
        if(services != '' ){
            concatUrl += '&services='+services;
        }

        var seller_level = get_filter('seller_level');
        if(seller_level != '' ){
            concatUrl += '&seller_level='+seller_level;
        }

        var lang = get_filter('lang');
        if(lang != '' ){
            concatUrl += '&lang='+lang;
        } 

        var seller_location = get_filter('seller_location');
        if(seller_location != '' ){
            concatUrl += '&seller_location='+seller_location;
        } 


        var brand = get_filter('brand');
        if(brand != '' ){
            concatUrl += '&brand='+brand;
        }        
        var ratting = get_filter('ratting');
        if(ratting != '' ){
            concatUrl += '&ratting='+ratting;
        }

        

        var delivery_time = get_filter('delivery_time');
        if(delivery_time != '' ){
            concatUrl += '&delivery_time='+delivery_time;
        }

        var min_price = document.getElementById('min-price').value;
        var max_price = document.getElementById('max-price').value;
     
        if(min_price && typeof min_price != 'undefined'){
            concatUrl += '&min_price='+min_price;
        }

        if(max_price && typeof max_price != 'undefined'){
            concatUrl += '&max_price='+max_price;
        }

     
        var perPage = null;
        var showItem = $("#perPage :selected").val();
        if(typeof showItem != 'undefined' || showItem != null){
           perPage = showItem;
           //check weather page null or set 
            if(page == null){
                //var active = $('.active .page-link').html();
                var page = 1;
            }
        }

        var pro_service = get_filter('pro_service');
        if(pro_service != '' ){
            concatUrl += '&pro_service='+pro_service;
        }

        var local_seller = get_filter('local_seller');
        if(local_seller != '' ){
            concatUrl += '&local_seller='+local_seller;
        }
        var online_seller = get_filter('online_seller');
        if(online_seller != '' ){
            concatUrl += '&online_seller='+online_seller;
        }

        if(page != null){concatUrl += '&page='+page;}
     
        var  link = 'https://www.laraup.com/cat/'+category+concatUrl;
            history.pushState({id: 'cat'}, category , link);

        $.ajax({
            url:link,
            method:"get",
            data:{
                filter:'filter',perPage:showItem
            },
            success:function(data){
               
                if(data){
                    $('#filter_product').html(data);
               }else{
                    $('#filter_product').html('Not Found');
               }
            },
            error: function() {
                $('#filter_product').html('<span class="ajaxError">Internal server error.!</span>');
            }

        });
    }

    function get_filter(class_name)
    {

        var filter = [];
        $('.'+class_name+':checked').each(function(){
            filter.push($(this).val());
        });
       
        return filter;
    }

    $('.common_selector').click(function(){
        filter_data();
    });

    function sortproduct(){
        filter_data();
    }
    function showPerPage(){
        filter_data();
    }

    function searchItem(value){
        if(value != ''){ filter_data(); }
    }

    $(document).on('click', '.pagination a', function(e){
        e.preventDefault();

        var page = $(this).attr('href').split('page=')[1];

        filter_data(page);
    });

    $('#resetPrice').click(function(){
        $("#min-price").val('');
        $("#max-price").val('');
        $('body').find('.open').removeClass().addClass('btn-group');
        //call function
        filter_data();
    });

    $('#resetServices').click(function(){
        $('.services_details input[type=checkbox]').removeAttr('checked');
        $('body').find('.open').removeClass().addClass('btn-group');
        //call function
        filter_data();
    });

    $('#reset_delivery_time').click(function(){
        $('.delivery_time input:radio').removeAttr('checked');
        $('body').find('.open').removeClass().addClass('btn-group');
        //call function
        filter_data();
    });

    $('#reset_seller_details').click(function(){
        $('.seller_details input[type=checkbox]').prop('checked', false);
        $('body').find('.open').removeClass().addClass('btn-group');
        //call function
        filter_data();
    });

    $('#resetAll').click(function(){
        $('input:checkbox').removeAttr('checked');
        $('input[type=checkbox]').prop('checked', false);
        $("#searchKey").val('');
        $('input:radio').removeAttr('checked');
        
        //call function
        filter_data();
    });
</script>
