<script type="bf1f681bd3a67f8b1f5529b3-text/javascript">
$("document").ready(function($){
    var nav = $('.navbar_top');

    $(window).scroll(function () {
        if ($(this).scrollTop() > 70) {
            nav.addClass("fixed-top");
        } else {
            nav.removeClass("fixed-top");
        }
    });
});
</script>
<script type="bf1f681bd3a67f8b1f5529b3-text/javascript">
    $(document).ready(function(){
        $('.searchKey').on('keyup', function(){
            var searchKey = $(this).val();
            if(searchKey){
                $.ajax({
                    type:"GET",
                    url: 'https://www.laraup.com/search/keyword?q='+searchKey,
                    success: function(data) {
                        if(data){
                            $(".searchResult").show();
                            $(".searchResult").html(data);
                        }else{
                            $(".searchResult").html('No result found.!');
                        }
                    }
                });
            }else{
                $(".searchResult").hide();
            }
        });
    });
    
    $('.mainArea').on('click', function (e) {
        if ($(e.target).closest("#searchResult").length === 0) {
            $("#searchResult").hide();
        }
    });
     $('#searchKey').on('click', function(){
        $("#searchResult").show();
    });
    $('#loginBtn').on("click", function() {
        $("#loginForm").fadeIn('fast');
        $("#registerForm").css("display","none");
        $("#recoverform").css("display","none");
    });   
    $('#recoverBtn').on("click", function() {
        $("#recoverform").fadeIn('fast');
        $("#loginForm").css("display","none");
       
    });   

    $('#registerBtn').on("click", function() {
        $("#loginForm").css("display","none");
        $("#registerForm").fadeIn('fast');
        
    });  

    $('#resetBtn').click('on', function(){
        var reseField = $('#reseField').val();
        if(reseField){
            $('#resetBtn').html('Sending...');
        }
    });
    
        // Resonsive Sidebar aside
    $(document).ready(function(){
      

        $(".open-usersidebar").click(function(e){
            e.preventDefault();
            $(".usersidebar").toggleClass("show");
            $(".usersidebar").toggleClass("active");
        });
        
     
        $('.close-sidebar').click(function() {
            $('.sidebar-overlay').removeClass('show');
            $('.sidebar-offcanvas').removeClass('active');
            
        }); 
    });
    $(".changeLang").change(function(){
        var url = "https://www.laraup.com/lang/:lang";
        url = url.replace(':lang', $(this).val());
        window.location.href = url ;
    });
</script>
<script type="bf1f681bd3a67f8b1f5529b3-text/javascript">
    $(".header-bottom a, .offerType_box a, .navbar-logo a, .vertical-wrapper a, a.offer_box,  .product-item-container a, .caption h4 a, .buyNowBtn, .products-category a, .offer_section a, .bottom-nav a, aside a").click(function () {
        $("#pageloaderOpend").css("display","block").fadeIn(3000);
         setTimeout(function () {
           $("#pageloaderOpend").css("display","none");
        }, 5000);
    });
  </script>
